export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},IwsPUl4vyt:{data:{id:2034,attributes:{imdbId:"tt1904996",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTk4MzM2NTQ1Nl5BMl5BanBnXkFtZTcwODIyODY1OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"40%"},{Source:"Metacritic",Value:"42\u002F100"}],item_lang:{data:{id:2697,attributes:{title:"Parker",plot:"Parker is a thief who has an unusual code. He doesn't steal from the poor and hurt innocent people. He is asked to join four other guys on a job. They pull it off flawlessly. They tell Parker that what they got can help them set up another job which will net them much more. But Parker doesn't want to join them and asks for his share. But they need it all so they try to kill him. They dispose of his body but someone finds him--he is still alive--and takes him to the hospital. After recovering he sets out to get back at the ones who tried to kill him, another one of his codes. Despite being told that they are working for a known mobster which he was not aware of, he still wants to go after them. He learns where they are and poses as a wealthy Texan looking to buy a house. So he hires a real estate agent, Leslie Rogers to show him around. He is actually trying to find out where they're holed up. And when he finds it, he sets out on his plan to get them. But when they learn he is alive, they contact the mobster to take care of him. So the mobster sends a killer to take care of him. And Leslie also finds herself intrigued with him so she follows him.",slug:"parker"}}},books:{data:[{id:10130,attributes:{title:"Parker: The Hunter",description:"Darwyn Cooke, Eisner-Award-winning writer\u002Fartist, sets his artistic sights on bringing to life one of the true classics of crime fiction: Richard Stark's Parker. Stark was a pseudonym used by the revered and multi-award-winning author, Donald Westlake. The Hunter, the first book in the Parker series, is the story of a man who hits New York head-on like a shotgun blast to the chest. Betrayed by the woman he loved and double-crossed by his partner in crime, Parker makes his way cross-country with only one thought burning in his mind - to coldly exact his revenge and reclaim what was taken from him! Parker: The Hunter is the latest offering in IDW Publishing's series of Digital Graphic Novels. We've assembled the best of favorite brands and respected creators for you to collect on your digital bookshelf. Story and art: Darwyn Cooke Editor: Scott Dunbier Features: - Page by page viewing, pinch and zoom for details - Tap user controls or swipe to turn pages - \"See all\" table of contents keywords: Darwyn, Cooke, Richard, Stark, Westlake, comic, graphic, novel, crime",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=v_BdCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,"Darwyn Cooke"],firstBook:true,published:"1904-01-01",publisher:"IDW Publishing",subtitle:a}},{id:10131,attributes:{title:"The Getaway Car",description:"\"Collection of published and unpublished gems: a memoir about learning to write, an imaginary interview between Westlake's various identities, essays on writing, introductions, and letters to writers like Stephen King and Brian Garfield. A true miscellany, this includes a piece by Abigail Westlake, a recipe for \"May's Famous Tuna Casserole\" and a 'Midnight snack'.\"--From the publisher.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=byyOBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2014-09-24",publisher:"University of Chicago Press",subtitle:"A Donald Westlake Nonfiction Miscellany"}},{id:10132,attributes:{title:g,description:a,thumbnail:a,authors:[c],firstBook:d,published:"1984-01-01",publisher:a,subtitle:a}},{id:10133,attributes:{title:g,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AzfOrQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Richard Stark"],firstBook:d,published:"2015-02-02",publisher:a,subtitle:a}},{id:10134,attributes:{title:"Price of Desire",description:a,thumbnail:a,authors:["Lawrence Block",c],firstBook:d,published:"2005-05-01",publisher:"BBC Audiobooks",subtitle:"Three Novellas from Transgressions"}}]}}},meta:{}}},prerenderedAt:1681309563872}}("","movie","Donald E. Westlake",null,"series",1,"The Hunter"))